                 Hubble Space Telescope: Discoveries-2010kaiser
                 ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~


Behind the Hubble Space Telescopes stunning images of the cosmos lies a record of scientific breakthroughts. Hubble has had a front-row seat for the explosive death of stars, measured the age of the universe, and studied planets beyond our solar system. Learn how Hubble has changed the face of astronomy and opened our eyes to some of the universes biggest mysteries.

Title: Hubble Space Telescope: Discoveries
Year: 2012
Publisher: NASA
Format: PDF


